  return(
    <th key = {day} className = "weekday">
      {day}
    </th>

  );
});
class Picker extends React.Component {
  /**
   * @return {object} a <div> containing an <h2>
   */
  render(){
    return (
        <div class = "form_inline">
          <button class ="button_outline" onclick = {previous()}>Previous</button>
          <button class ="button_outline"onclick = {next()}>Next</button>
